import {
    Form,
    Select,
    InputNumber,
    DatePicker,
    Switch,
    Slider,
    Button,
    Input
  } from "antd";
  import Link from "next/link";
  
  const FormItem = Form.Item;
  
  function selectData() {
    return (
      <div style={{ marginTop: 0,width:"100%",maxWidth:"480px"}}>
        <FormItem>
          <div className="nu-font-covid">
            <div>
              Picture
              <form>
                <h3 style={{ color: "white",fontSize:"18px" }}>ชื่อ สกุล</h3>
                <Input
                  style={{height:"62px",borderRadius:"31px",fontSize:"22px",padding:"0 10px"}}
                  placeholder="ชื่อ สกุล"
                  type="text"
                  /*value={Name}
                  onChange={(e) => updateName(e.target.value)}*/
                />
                <h3 style={{ color: "white",fontSize:"18px" }}>หมายเลขประจำตัวประชาชน</h3>
                <Input
                style={{height:"62px",borderRadius:"31px"}}
                  placeholder="หมายเลขประจำตัวประชาชน"
                  type="text"
                  /*value={SSID}
                  onChange={(e) => updateSSID(e.target.value)}*/
                  required
                />
                <h3 style={{ color: "white",fontSize:"18px" }}>วัน เดือน ปีเกิด</h3>
                <DatePicker
                  style={{
                    width: "100%",
                    justifyContent: "flex-end",
                    alignItems: "flex-end",
                    display: "flex",
                  }}
                  /*onChange={handleChange}*/
                  required
                />
                <h3 style={{ color: "white",fontSize:"18px" }}>รหัสไปรษณีย์</h3>
                <Input
                style={{height:"62px",borderRadius:"31px"}}
                  placeholder="รหัสไปรษณีย์"
                  type="text"
                  /*value={PostId}
                  onChange={(e) => updatePostId(e.target.value)}*/
                  required
                />
              </form>
            </div>
          </div>
        </FormItem>
      </div>
    );
  }
  
  export default selectData;
